#!/usr/bin/env octave

global seed;

function [r] = get_rand_int(n)
	global seed;
	m = 100003;
	a = 1103515245;
	c = 12345;
	seed = mod(a * seed + c, m);
	% printf('seed after == %d\n', seed);
	r = mod(seed, n);
end

function [array] = random_permutation(n)
	array = [1 : n];
	if n == 1
		return
	end
	for i = n : -1 : 2
		% j = randi([1, i], 1);
		j = get_rand_int(i) + 1;
		% printf('j == %d\n', j);
		aux = array(i);
		array(i) = array(j);
		array(j) = aux;
	end
end


function [ker,kern]=kernelizationbis(data,databis)

    [L,N]=size(data);
    [M,N]=size(databis);
    printf('data--%s\n', mat2str(size(data)));
    printf('databis--%s\n', mat2str(size(databis)));

    % printf('sum(data.^2, 2)--%s\n', mat2str(size(sum(data.^2, 2))));
    norms=sum(data.^2, 2) * ones(1, M);
    printf('norms--%s\n', mat2str(size(norms)));
    normsbis = sum(databis.^2, 2) * ones(1, L);
    printf('normsbis--%s\n', mat2str(size(normsbis)));
    ker = norms + normsbis' - 2 * data * (databis');
    printf('ker--%s\n', mat2str(size(ker)));
end % function kernalizationbis


function [out,ener]=constrained_assignment(X, C, K)
% Assign samples to the nearest centers, but with the constraint that each center receives K samplesA
    w=kernelizationbis(X',C');
    % printf('%s\n', mat2str(w));

    [N,M]=size(w); %N number of samples, M number of centers

    % maxvalue = max(w(:))+1;

    [ds,I]=sort(w,2,'ascend');
    %[ds2,I2]=sort(w,1,'ascend');
    % printf('ds == %s\n', mat2str(ds));
    % printf('I == %s\n', mat2str(I));

    out=I(:,1);
    printf('out--%s\n', mat2str(size(out)));
    % printf('%s\n', mat2str(out));
    for m=1:M
	found = find(out == m);
	% printf('%s\n', mat2str(found));
        taille(m)=length(find(out==m));
    end
    printf('taille == %s\n', mat2str(taille));
    % printf('taille == %s\n', mat2str(taille));
    [hmany,nextclust]=max(taille);
    printf('hmany == %d ; nextclust == %d\n', hmany, nextclust);
    % printf('nextclust == %d\n', nextclust);
    % printf('hmany == %d\n', hmany);

    % visited=zeros(1, M);
    visited=zeros(M);

    go=(hmany > K);
    choices=ones(N,1);

    while go
        %fprintf('%d %d \n', nextclust, hmany)
        aux=find(out==nextclust);
        for l=1:length(aux)
            slice(l) = ds(aux(l), choices(aux(l)) + 1) - ds(aux(l), choices(aux(l)));
        end
	printf('slice--%s\n', mat2str(size(slice)));
        [~,tempo] = sort(slice,'descend');
        clear slice;
        %slice=w(aux,nextclust);
        %[~,tempo]=sort(slice,'ascend');

	
	printf('tempo[0:K] ==\n    %s\n', mat2str(tempo(1:K)));
        saved = aux(tempo(1:K));
        out(saved) = nextclust;

        visited(nextclust)=1;
        for k = K+1:length(tempo)
           i = 2;
           while visited(I(aux(tempo(k)),i))
              i = i+1;
           end
           out(aux(tempo(k))) = I(aux(tempo(k)),i);
           choices(aux(tempo(k))) = i;
        end
        for m = 1:M
            taille(m) = length(find(out==m));
        end
        printf('taille == %s\n', mat2str(taille));
        [hmany,nextclust] = max(taille);
        printf('hmany == %d ; nextclust == %d\n', hmany, nextclust);
        go=(hmany > K);
    end

    ener=0;
    for n = 1:N
        ener=ener+w(n,out(n));
    end

end % function constrained_assignement


function [outlabel,outm] = litekmeans(X, k)
% Perform k-means clustering.
%   X: d x n data matrix
%   k: number of seeds
% Written by Michael Chen (sth4nth@gmail.com).
% Modified by Joan Bruna to have constant cluster sizes

    n = size(X,2);
    last = 0;

    minener = 1e+20;
    outiters=30;
    maxiters=1000;

    for j=1:outiters
        % fprintf(2, '* Iter %d / %d\n', j, outiters);
        % s = RandStream('mt19937ar','Seed',j);
        rand('seed', 0);
        % aux=randperm(s, n);
        % aux=randperm(n);
        aux=random_permutation(n);
        m = X(:,aux(1:k));
	% printf('%s\n', mat2str(m));
        %[~,label] = max(bsxfun(@minus,m'*X,dot(m,m,1)'/2),[],1); % assign samples to the nearest centers
        [label] = constrained_assignment(X, m, n/k);
        assignment_distribution = zeros(k, 1);
        for i = 1:length(label)
            assignment_distribution(label(i)) = assignment_distribution(label(i)) + 1;
        end
        % printf('assignment_distribution == %s\n', mat2str(assignment_distribution));

        iters=0;

        while any(label ~= last) && iters < maxiters
            [u, ~, label] = unique(label);   % remove empty clusters
            k = length(u);
            E = sparse(1 : n, label, 1, n, k, n);  % transform label into indicator matrix
    	    % printf('%s\n', mat2str(label));
    	    % printf('%s\n', mat2str(E));
            m = X * full(E * spdiags(1 ./ sum(E, 1)', 0, k, k));    % compute m of each cluster
    	    % printf('m--%s\n', mat2str(size(m)));
            last = label;
            %[~,label] = max(bsxfun(@minus,m'*X,dot(m,m,1)'/2),[],1); % assign samples to the nearest centers
            [label, ener] = constrained_assignment(X, m, n / k);
    	    assignment_distribution = zeros(k, 1);
    	    for i = 1:length(label)
    	        assignment_distribution(label(i)) = assignment_distribution(label(i)) + 1;
    	    end
    	    % printf('assignment_distribution == %s\n', mat2str(assignment_distribution));
            iters = iters + 1;
        end

        [~,~,label] = unique(label);

        if ener < minener
            outlabel = label;
            outm = m;
            minener = ener;
        end
    end
end % function litekmeans


function [Wapprox, C, Z, F, idx_input, idx_output] = bispace_svd(W, iclust, iratio, oclust, oratio, conseq, in_s, out_s)
    fprintf('iclust = %d, iratio = %f, oclust = %d, oratio = %f, conseq = %d\n', iclust, iratio, oclust, oratio, conseq);
    oclust_sz = size(W, 1) / oclust;
    iclust_sz = size(W, 4) / iclust;

    odegree = floor(size(W, 1) * oratio / oclust);
    idegree = floor(size(W, 4) * iratio / iclust);

    orig_ops = out_s * out_s * prod(size(W));

    approx_ops = iclust * oclust * [in_s * in_s * iclust_sz * idegree, ...
                                    out_s * out_s * idegree * odegree * size(W, 2) * size(W, 3), ...
                                    out_s * out_s * odegree * oclust_sz];
    % printf('approx_ops == %s\n', mat2str(approx_ops));
    fprintf('Input rank: %d\n', idegree);
    fprintf('Output rank: %d\n', odegree);
    fprintf('Gain : %f\n', orig_ops / (sum(approx_ops)));
    fprintf('Transform 1 : %f\n', approx_ops(1) / sum(approx_ops));
    fprintf('Conv : %f\n', approx_ops(2) / sum(approx_ops));
    fprintf('Transform 3 : %f\n', approx_ops(3) / sum(approx_ops));
    fprintf('\n----------------\n\n');

    % conseq = ~conseq
    if (~conseq)
        WW = W(:,:); % shape is [output_channels, everything_else]
        % printf('%s\n', mat2str(WW'));
        % printf('%s\n', mat2str(WW'));
        idx_output = litekmeans(WW', oclust);
        printf('idx_output--%s\n', mat2str(size(idx_output)));
        % printf('%s\n', mat2str(idx_output));
        WW = permute(W, [4 2 3 1]);
        WW = WW(:, :);
        idx_input = litekmeans(WW', iclust);
    else
        for i = 1 : iclust
            idx_input(((i - 1) * iclust_sz + 1) : (i * iclust_sz)) = i;
        end
        for o = 1 : oclust
            idx_output(((o - 1) * oclust_sz + 1) : (o * oclust_sz)) = o;
        end
    end

    fprintf('\n----------------\n\n');
    C = zeros(size(W, 4) / iclust, idegree, iclust, oclust);
    Z = zeros(odegree, size(W, 2), size(W, 3), idegree, iclust, oclust);
    F = zeros(size(W, 1) / oclust, odegree, iclust, oclust);
	printf('C--%s\n', mat2str(size(C)));
	printf('Z--%s\n', mat2str(size(Z)));
	printf('F--%s\n', mat2str(size(F)));

    for i = 1 : iclust
        for o = 1 : oclust
            oidx = idx_output == o;
            iidx = idx_input == i;

            Wtmp = W(oidx, :, :, iidx);
            printf('W--%s\n', mat2str(size(W)));
            printf('Wtmp--%s\n', mat2str(size(Wtmp)));

            [u, s, v] = svd(Wtmp(:, :));
            printf('u--%s\n', mat2str(size(u)));
            printf('s--%s\n', mat2str(size(s)));
            printf('v--%s\n', mat2str(size(v)));
            F_ = u(:, 1:odegree) * s(1:odegree, 1:odegree);
            printf('F_--%s\n', mat2str(size(F_)));

            Wtmptmp = F_ * v(:, 1:odegree)';
            F(:, :, i, o) = F_;

            Wapprox_tmp = reshape(v(:, 1:odegree)', [odegree, size(Wtmp, 2), size(Wtmp, 3), size(Wtmp, 4)]);
            Wapprox_tmp = permute(Wapprox_tmp, [4, 1, 2, 3]);
            printf('Wapprox_tmp--%s\n', mat2str(size(Wapprox_tmp)));

            [u, s, v] = svd(Wapprox_tmp(:, :));
            printf('u--%s\n', mat2str(size(u)));
            printf('s--%s\n', mat2str(size(s)));
            printf('v--%s\n', mat2str(size(v)));
            C_ = u(:, 1:idegree) * s(1:idegree, 1:idegree);
            printf('C_--%s\n', mat2str(size(C_)));
            C(:, :, i, o) = C_;
            Z_ = v(:, 1:idegree);
            % Wtmptmptmp_ = C_ * Z_';
            printf('Z_--%s\n', mat2str(size(Z_)));
            Z(:, :, :, :, i, o) = reshape(Z_, [odegree, size(W, 2), size(W, 3), idegree]);
        end
    end

    fprintf('\n----------------\n\n');
    Wapprox = zeros(size(W));
    for i = 1 : iclust
        for o = 1 : oclust
            oidx = idx_output == o;
            iidx = idx_input == i;

            C_ = C(:, :, i, o);
            Z_ = Z(:, :, :, :, i, o);
            F_ = F(:, :, i, o);
            Z_ = permute(Z_, [4, 1, 2, 3]);
            Z_ = Z_(:, :)';
            ZC = Z_ * C_';
            printf('ZC--%s == Z_--%s * C_''--%s\n', mat2str(size(ZC)), mat2str(size(Z_)), mat2str(size(C_')));

            Wtmptmptmp = reshape(ZC, [odegree, size(W, 2), size(W, 3), iclust_sz]);
            Wtmptmptmp = Wtmptmptmp(:, :);
            printf('Wtmptmptmp--%s\n', mat2str(size(Wtmptmptmp)));
            Wtmp = F_ * Wtmptmptmp;


            Wtmp = reshape(Wtmp, [oclust_sz, size(W, 2), size(W, 3), iclust_sz]);
            printf('Wtmp--%s\n', mat2str(size(Wtmp)));
            printf('Wapprox--%s\n', mat2str(size(Wapprox)));
            Wapprox(oidx, :, :, iidx) = Wtmp;
        end
    end

    fprintf('norm(W(:)) = %f\n', norm(W(:)));
    fprintf('norm(Wapprox(:)) = %f\n', norm(Wapprox(:)));
    fprintf('||W - Wapprox|| / ||W|| = %f\n', norm(W(:) - Wapprox(:)) / norm(W(:)));
    % printf('%e\n', Wapprox(3, 3, 3, 3));
end % function bispace_svd


